import React, { Component } from 'react';
import data from '../assets/codebeautify.json'
import { Preview, print } from 'react-html2pdf';
import logo from '../assets/logo_sayse.png';
export default class getData extends Component {


    componentDidMount() {

    }

    render() {
        return (
            <div class="container">
                <Preview id={'PdfDevis'} >
                <div>
                    <div class="row">
                    <div className="col-4 mt-2">
                        <img src={logo} alt="logo_sayse"></img>
                    </div>
                    <div className="col-4 text-center text-danger mt-5">
                    <p>Devis pour solutions</p>
                    </div>
                    <div className="col-4"></div>
                    </div>
                    <hr></hr>
                </div>

                </Preview>
                <div className="row">
                    <div className="col-4"></div>
                    <div className="col-4 text-center" style={{ marginTop:'20%'}}>
                        <button className="degrade-btn btn" onClick={() => print('Devis', 'PdfDevis')}> Telecharger</button>
                    </div>
                    <div className="col-4"></div>
                </div>

            </div>
        );
    }
}
